import React from 'react'
import styled from 'styled-components';

import { useDispatch } from 'react-redux';
import { expandNav } from '../actions'


const Styles = styled.div`
	.nav {
		background-color: black;
		color: white;
		width: 15%;
		height: 25%;
		position: fixed;
		top: 0;
		left: 0;
	}
`;

export default class NavigationBar extends React.Component {
	render() {
		const dispatch = useDispatch();


		return(
			<Styles>
			<div className='nav'>
				<button onClick={() => dispatch(expandNav())}>-</button>
				<ul>
					<li><a href='#notvalid'>My Account</a></li>
					<li><a href='#notvalid'>My Characters</a></li>
					<li><a href='#notvalid'>About MTTH</a></li>
					<li><a href='#notvalid'>Contact</a></li>
				</ul>
			</div>
			</Styles>
		)
	}
}
